sources.sass\\components\\_menu.scss:
.menu {
  visibility: hidden;

  &_heading {
    color: $color-purple;
    font-size: 3rem;
    font-weight: 300;

    border-bottom: 2px solid;

    position: absolute;
    top: 8rem;
    left: $margin;
    padding: 0;
  }

  &_container {
    width: $slider-size;
    height: 100vh;
    display: grid;
    align-items: center;

    background: rgba($color-black, 0.5);

    @include tablet {
      width: 100vw;
    }
  }

  &_list {
    list-style: none;
    width: 80%;
    margin: auto;

    &-item {
      margin: 6rem 0;
      padding: 1rem;
      border-left: 2px solid $color-purple;

      transition: all 0.1s ease-in;

      &:hover {
        border-left: 2px solid $color-mint;
        transform: translateX(1rem);
      }
    }
  }
}

.wrapper {
  width: 3.5rem;
  height: 3.5rem;
  display: flex;
  flex-direction: column;
  justify-content: space-between;
  cursor: pointer;
  transition: transform 330ms ease-out;

  .line {
    transition: 0.2s ease-in;
    background-color: $color-purple;
    width: 100%;
    height: 2px;
    &.half {
      width: 50%;
      &.start {
        transition: transform 330ms cubic-bezier(0.54, -0.81, 0.57, 0.57);
        transform-origin: right;
      }
      &.end {
        align-self: flex-end;
        transition: transform 330ms cubic-bezier(0.54, -0.81, 0.57, 0.57);
        transform-origin: left;
      }
    }
  }
  &.open {
    transform: rotate(-45deg);
    .line {
      &.start {
        transform: rotate(-90deg) translateX(0px);
      }
      &.end {
        transform: rotate(-90deg) translateX(-2px);
      }
    }
  }
  &:hover {
    .line {
      background-color: $color-mint;
    }
  }
}
.nav_user:hover {
  & circle,
  path,
  line {
    stroke: $color-mint;
  }
}
.nav_user > circle,
path {
  transition: 0.2s ease-in;
}

#menu:target {
  visibility: visible;
}

#menu:target + #game {
  display: none !important;
}

.u-close-right:hover {
  & line {
    stroke: $color-mint;
  }
}

.phone {
  height: 50px;
  width: 90px;
  border: 3px solid $color-mint;
  border-radius: 10px;
  animation: rotate 1.5s ease-in-out infinite alternate;
  margin-bottom: -20px;
}

@keyframes rotate {
  0% {
    transform: rotate(0deg);
  }
  50% {
    transform: rotate(-90deg);
  }
  100% {
    transform: rotate(-90deg);
  }
}

.loader {
  width: 35px;
  height: 35px;
  border: 2px solid $color-mint;
  border-radius: 50%;
  animation: spin 7s linear infinite;
  position: relative;
  left: 25px;
  top: 5px;

  &:before,
  &:after {
    content: "";
    display: block;
    width: 10px;
    height: 10px;
    border-top: 2px solid $color-mint;
    border-right: 2px solid $color-mint;
    position: absolute;
    top: 5px;
    left: -5px;
    transform: rotate(350deg);
  }
}

@keyframes spin {
  0% {
    transform: rotate(0deg);
  }
  100% {
    transform: rotate(360deg);
  }
}

