.modal_winner {
  display: none;
  height: 100%;
  width: 100%;

  //   display: grid;
  place-items: center;
  position: absolute;
  z-index: 150;
  background-color: rgba(0, 0, 0, 0.8);

  &_body {
    width: 40%;
    height: 40%;
    &-message {
      text-align: center;
      font-size: $text-xl;
      color: $game-mint;
      font-weight: 300;
      text-transform: uppercase;
    }
    &_notlogged {
      display: none;
      &-p {
        color: $color-purple;
        font-size: 1.4rem;
        font-weight: 600;
        text-align: center;
        margin-bottom: 2rem;
      }
      &_buttons {
        button:first-child {
          margin-bottom: 1rem;
        }
      }
    }
    &_logged {
      display: none;
    }
  }
}

sources.sass\\components\\game\\_storeModal.scss:
.store {
  width: 100%;
  height: 100%;

  display: none;
  place-items: center;

  position: absolute;
  top: 0;
  left: 0;

  background: rgba(0, 0, 0, 0.8);

  &_container {
    width: 50%;
  }

  &_close {
    position: absolute;
    top: 2rem;
    right: 4rem;
    font-size: 6rem;
    font-weight: 100;

    cursor: pointer;
  }

  &_themes {
    display: grid;
    grid-template-columns: repeat(4, 1fr);
    grid-template-rows: 5rem;
    grid-gap: 1rem;

    margin-top: 1rem;

    &-color {
      width: 60%;
      height: 60%;
    }

    .pink {
      border-radius: 1rem;
      border: 2px solid #fffc31;
      background: transparent;
      cursor: pointer;

      transition: all 0.1s ease-in;

      &:hover {
        background: #fffc31;
      }
    }

    .orange {
      border-radius: 1rem;
      border: 2px solid #f99419;
      background: transparent;
      cursor: pointer;

      transition: all 0.1s ease-in;

      &:hover {
        background: #f99419;
      }
    }

    .violet {
      border-radius: 1rem;
      border: 2px solid #47c8ff;
      background: transparent;
      cursor: pointer;

      transition: all 0.1s ease-in;

      &:hover {
        background: #47c8ff;
      }
    }

    .red {
      border-radius: 1rem;
      border: 2px solid #ff84e8;
      background: transparent;
      cursor: pointer;

      transition: all 0.1s ease-in;

      &:hover {
        background: #ff84e8;
      }
    }
  }
}

